-- ----------------------------
-- View structure for tv_studentcultivate
-- ----------------------------
DROP VIEW IF EXISTS `tv_studentcultivate`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `tv_studentcultivate` AS select `s`.`id` AS `studentId`,`s`.`realName` AS `realName`,`s`.`idCard` AS `idCard`,`s`.`unit` AS `unit`,`c`.`id` AS `cultivateId`,`c`.`cultivateName` AS `cultivateName`,`c`.`cultivateType` AS `cultivateType`,`c`.`cultivateDataCode` AS `cultivateDataCode`,`c`.`beginTime` AS `beginTime`,`c`.`endTime` AS `endTime` from ((`tb_student_manage` `s` left join `tb_cultivate_student` `cs` on((`s`.`id` = `cs`.`studentId`))) left join `tb_cultivate_manage` `c` on((`cs`.`cultivateId` = `c`.`id`))) where ((`s`.`status` = 1) and (`c`.`status` = 1));

-- ----------------------------
-- View structure for tv_studentestimate
-- ----------------------------
DROP VIEW IF EXISTS `tv_studentestimate`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `tv_studentestimate` AS select `es`.`studentId` AS `studentId`,`s`.`realName` AS `realName`,`s`.`idCard` AS `idCard`,`s`.`unit` AS `unit`,`s`.`department` AS `department`,`s`.`job` AS `job`,`es`.`cultivateId` AS `cultivateId`,`es`.`estimateId` AS `estimateId`,`es`.`estimateCode` AS `estimateCode`,`es`.`estimateTime` AS `estimateTime`,`es`.`answer` AS `answer`,`qe`.`content` AS `content`,`qe`.`isPublish` AS `isPublish`,`em`.`estimateDataCode` AS `estimateDataCode`,`em`.`answerLimitNum` AS `answerLimitNum`,`es`.`answerNum` AS `answerNum` from ((((`tb_estimate_student` `es` left join `tb_student_manage` `s` on((`s`.`id` = `es`.`studentId`))) left join `tb_estimate_manage` `em` on((`es`.`estimateId` = `em`.`id`))) left join `tb_questionnaire_estimate` `qe` on((`qe`.`estimateId` = `es`.`estimateId`))) left join `tb_cultivate_manage` `cm` on((`em`.`cultivateId` = `cm`.`id`))) where ((`em`.`status` = 1) and (`s`.`status` = 1));

-- ----------------------------
-- View structure for tv_studentexamination
-- ----------------------------
DROP VIEW IF EXISTS `tv_studentexamination`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `tv_studentexamination` AS select `es`.`studentId` AS `studentId`,`s`.`realName` AS `realName`,`s`.`idCard` AS `idCard`,`s`.`unit` AS `unit`,`s`.`department` AS `department`,`s`.`job` AS `job`,`s`.`phone` AS `phone`,`es`.`cultivateId` AS `cultivateId`,`es`.`examinationId` AS `examinationId`,`em`.`examinationName` AS `examinationName`,`es`.`examinationCode` AS `examinationCode`,`em`.`examinationTime` AS `examinationTime`,`em`.`examinationEndTime` AS `examinationEndTime`,`es`.`openTime` AS `openTime`,`es`.`closeTime` AS `closeTime`,`es`.`stuMakeUpNum` AS `stuMakeUpNum`,`es`.`isPassing` AS `isPassing`,`es`.`score` AS `score`,`em`.`isRelease` AS `isRelease`,`cm`.`cultivateName` AS `cultivateName`,`es`.`certificateNo` AS `certificateNo`,`es`.`certificateTime` AS `certificateTime`,`em`.`isCertificateNo` AS `isCertificateNo`,(case when ((`em`.`makeupNum` - `es`.`stuMakeUpNum`) > 0) then (`em`.`makeupNum` - `es`.`stuMakeUpNum`) else 0 end) AS `residueNum`,`te`.`content` AS `content`,`te`.`isPublish` AS `isPublish`,`em`.`makeupBeginTime` AS `makeupBeginTime`,`em`.`makeupTime` AS `makeupTime`,`te`.`totalScore` AS `totalScore`,`em`.`passingScoreLine` AS `passingScoreLine`,`em`.`examinationTimeLimit` AS `examinationTimeLimit`,`em`.`timingMode` AS `timingMode`,`em`.`isResit` AS `isResit`,`em`.`examinationDataCode` AS `examinationDataCode`,`em`.`isDisorder` AS `isDisorder`,`em`.`isAnswerAnalysis` AS `isAnswerAnalysis`,`es`.`answer` AS `answer`,`es`.`willCloseTime` AS `willCloseTime` from ((((`tb_examination_student` `es` left join `tb_student_manage` `s` on((`s`.`id` = `es`.`studentId`))) left join `tb_examination_manage` `em` on((`es`.`examinationId` = `em`.`id`))) left join `tb_testpaper_examination` `te` on((`te`.`examinationId` = `es`.`examinationId`))) left join `tb_cultivate_manage` `cm` on((`em`.`cultivateId` = `cm`.`id`))) where ((`em`.`status` = 1) and (`s`.`status` = 1));

