-- Procedure structure for proc_addEstimateByCopy
-- ----------------------------
DROP PROCEDURE IF EXISTS `proc_addEstimateByCopy`;
delimiter ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `proc_addEstimateByCopy`(IN t_estimateId VARCHAR(50),IN t_inputName VARCHAR(200),OUT t_result VARCHAR(10))
BEGIN
		-- DROP PROCEDURE IF EXISTS proc_addEstimateByCopy; -- 删除原来的存储过程,放在这里备份
		
		DECLARE p_estimateId VARCHAR (64);
		
		DECLARE result_code INTEGER DEFAULT 0; -- 定义错误码初始化(0正常  1错误)
		DECLARE EXIT HANDLER FOR SQLEXCEPTION SET result_code = 1; -- 设定错误码
			
		START TRANSACTION; -- 开始事务

		-- 评估
		SELECT t_inputName,cultivateId,estimateBeginTime,estimateEndTime,estimateDataCode,answerLimitNum FROM tb_estimate_manage WHERE id = t_estimateId;
					
		-- 查找刚新增的评估
		SELECT id FROM tb_estimate_manage WHERE estimateName = t_inputName LIMIT 1 INTO p_estimateId;
					
		-- 问卷
		SELECT p_estimateId,content FROM tb_questionnaire_estimate WHERE estimateId = t_estimateId;
		
		-- 评估学员中间表
		SELECT p_estimateId,cultivateId,studentId FROM tb_estimate_student WHERE estimateId = t_estimateId;
		
		IF result_code = 1 THEN -- 可以根据不同的业务逻辑错误返回不同的result_code，这里只定义了1和0
				ROLLBACK; 
		ELSE 
				COMMIT; 
		END IF;
				
		SET t_result = result_code;
END;
;;
delimiter ;

