DROP PROCEDURE IF EXISTS `proc_addExaminationByCopy`;
delimiter ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `proc_addExaminationByCopy`(IN t_examinationId VARCHAR(50),IN t_inputName VARCHAR(200),OUT t_result VARCHAR(10))
BEGIN
		-- DROP PROCEDURE IF EXISTS proc_addExaminationByCopy; -- 删除原来的存储过程,放在这里备份
		
		DECLARE p_examinationId VARCHAR (64);
		
		DECLARE result_code INTEGER DEFAULT 0; -- 定义错误码初始化(0正常  1错误)
		DECLARE EXIT HANDLER FOR SQLEXCEPTION SET result_code = 1; -- 设定错误码
			
		START TRANSACTION; -- 开始事务

		-- 考试
		timingMode,isResit,makeupBeginTime,isDisorder) 
		SELECT t_inputName,cultivateId,examinationTime,examinationEndTime,examinationDataCode,examinationTimeLimit,makeupNum,makeupTime,passingScoreLine,
		timingMode,isResit,makeupBeginTime,isDisorder FROM tb_examination_manage WHERE id = t_examinationId;
	
		-- 查找刚新增的考试
		SELECT id FROM tb_examination_manage WHERE examinationName = t_inputName LIMIT 1 INTO p_examinationId;
					
		-- 试卷
		SELECT p_examinationId,content,totalScore FROM tb_testPaper_examination WHERE examinationId = t_examinationId;
		
		-- 考试学员中间表
		SELECT p_examinationId,cultivateId,studentId FROM tb_examination_student WHERE examinationId = t_examinationId;

		IF result_code = 1 THEN -- 可以根据不同的业务逻辑错误返回不同的result_code，这里只定义了1和0
				ROLLBACK; 
		ELSE 
				COMMIT; 
		END IF;
				
		SET t_result = result_code;
END;
;;
delimiter ;

SET FOREIGN_KEY_CHECKS = 1;
