":2,\"trueAnswer\":[\"1\"],\"answerAnalysis\":\"按时打算大所大\"},{\"title\":\"32.《招标公告和公示信息发布管理办法》规定：发布媒介应当按照规定采取有效措施,确保发布招标公告和公示信息的数据电文不被篡改、不遗漏和至少 15年内可追溯.\",\"score\":\"2\",\"op\":[\"A.对；\"],\"subjectType\":2,\"trueAnswer\":[\"1\"],\"answerAnalysis\":\"\"}]', 30, 1, '2020-04-25 23:49:00', '2020-04-25 23:49:00', 0, 57.0);
