INSERT INTO `tb_testPaper_examination` VALUES (5, '[{\"title\":\"《招标公告和公示信息发布管理办法》规定发布媒介应当按照规定采取有效措施,确保发布招标公告和公示信息的数据电文不被篡改、不遗漏和至少(  )年内可追溯。\",\"score\":\"7\",\"op\":[\"A.5\",\"B.10\",\"C.15\",\"D.20\"],\"subjectType\":0,\"trueAnswer\":[\"2\"],\"answerAnalysis\":\"《招标公告和公示信息发布管理办法》第十一条第四款：发布媒介应当按照规定采取有效措施,确保发布招标公告和公示信息的数据电文不被篡改、不遗漏和至少10年内可追溯.\"},{\"title\":\"《招标公告和公示信息发布管理办法》规定依法必须招标项目的招标公告和公示信息应当在(  )或者项目所在地省级电子招标投标公共服务平台发布。\",\"score\":\"7\",\"op\":[\"A.中国采购与招标网\",\"B.中国招标投标公共服务平台\",\"C.招标人采购平台\",\"D.招标代理机构平台\"],\"subjectType\":0,\"trueAnswer\":[\"2\"],\"answerAnalysis\":\"《招标公告和公示信息发布管理办法》第八条 依法必须招标项目的招标公告和公示信息应当在中国招标投标公共服务平台或者项目所在地省级电子招标投标公共服务平台(以下统一简称发布媒介发布。\"},{\"title\":\"《招标公告和公示信息发布管理办法》规定依法必须招标项目的中标候选人公示应当载明以下内容,不正确的是(  )。\",\"score\":\"7\",\"op\":[\"A.中标候选人排序、名称、投标报价、质量、工期(交货期),以及评标情况\",\"B.中标候选人按照招标文件要求承诺的项目负责人姓名及其相关证书名称和编号\",\"C.中标候选人响应招标文件要求的资格能力条件及评分\",\"D.提出异议的渠道和方式及招标文件规定公示的其他内容\"],\"subjectType\":0,\"trueAnswer\":[\"3\"],\"answerAnalysis\":\"《招标公告和公示信息发布管理办法》第六条规定依法必须招标项目的中标候选人公示应当载明以下内容：(一)中标候选人排序、名称、投标报价、质量、工期(交货期),以及评标情况；(二)中标候选人按照招标文件要求承诺的项目负责人姓名及其相关证书名称和编号；(三)中标候选人响应招标文件要求的资格能力条件；(四)提出异议的渠道和方式；(五)招标文件规定公示的其他内容.\"},{\"title\":\"《招标公告和公示信息发布管理办法》规定按照电子招标投标有关数据规范要求交互招标公告和公示信息文本的,发布媒介应当自收到起(  )发布.采用电子邮件、电子介质、传真、纸质文本等其他形式提交或者直接录入招标公告和公示信息文本的,发布媒介应当自核验确认起(  )内发布.核验确认最长不得超过(  )。\",\"score\":\"7\",\"op\":[\"A.12小时内、1个工作日、3个工作日\",\"B.6小时内、1日、3日\",\"C.6小时内、1个工作日、3个工作日\",\"D.12小时内、1日、3日\"],\"subjectType\":0,\"trueAnswer\":[\"1\"],\"answerAnalysis\":\"《招标公告和公示信息发布管理办法》第十一条第二款按照电子招标投标有关数据规范要求交互招标公告和公示信息文本的,发布媒介应当自收到起12小时内发布.采用电子邮件、电子介质、传真、纸质文本等其他形式提交或者直接录入招标公告和公示信息文本的,发布媒介应当自核验确认起1个工作日内发布.核验确认最长不得超过3个工作日.\"},{\"title\":\"《招标公告和公示信息发布管理办法》规定,依法必须招标项目的招标公告和公示信息, 除依法需要保密或者涉及商业秘密的内容外,应当按照( )、集中共享的原则,依法向社会公开。\",\"score\":\"7\",\"op\":[\"A.公益服务\",\"B.公开透明\",\"C.高效便捷\",\"D.以上都有\"],\"subjectType\":0,\"trueAnswer\":[\"4\"],\"answerAnalysis\":\"《招标公告和公示信息发布管理办法》第三条：依法必须招标项目的招标公告和公示信息, 除依法需要保密或者涉及商业秘密的内容外,应当按照公益服务、公开透明、高效便捷、集中共享的原则,依法向社会公开。\"},{\"title\":\"《招标公告和公示信息发布管理办法》规定,()根据招标投标法律法规规定,对依法必须招标项目招标公告和公示信息发布媒介的信息发布活动进行监督管理.省级发展改革部门对本行政区域内招标公告和公示信息发布活动依法进行监督管理.省级人民政府另有规定的,从其规定。\",\"score\":\"7\",\"op\":[\"A.人民法院\",\"B.财政部\",\"C.人民代表\",\"D.国家发展改革委\"],\"subjectType\":0,\"trueAnswer\":[\"4\"],\"answerAnalysis\":\"\"},{\"title\":\"根据《招标公告和公示信息发布管理办法》规定,招标人或其招标代理机构有下列行为之一的,由有关行政监督部门责令改的是(   )。\",\"score\":\"5\",\"op\":[\"A.依法必须公开招标的项目不按照规定在发布媒介发布招标公告和公示信息\",\"B.影响潜在投标人申请资格预审或者投标\",\"C.资格预审公告或者招标公告中以不合理的条件限制或者排斥潜在投标人\",\"D.资格预审公告或者招标公告中有关获取资格预审文件或者招标文件的时限不符合招标投标法律法规规定\",\"E.以上均正确\"],\"subjectType\":1,\"scoreType\":0,\"trueAnswer\":[\"1\",\"3\",\"4\"],\"answerAnalysis\":\"《招标公告和公示信息发布管理办法》第十八条　招标人或其招标代理机构有下列行为之一的,由有关行政监督部门责令改正,并视情形依照《中华人民共和国招标投标法》第四十九条、第五十一条及有关规定处罚：(一)依法必须公开招标的项目不按照规定在发布媒介发布招标公告和公示信息；(二)在不同媒介发布的同一招标项目的资格预审公告或者招标公告的内容不一致,影响潜在投标人申请资格预审或者投标；(三)资格预审公告或者招标公告中有关获取资格预审文件或者招标文件的时限不符合招标投标法律法规规定；(四)资格预审公告或者招标公告中以不合理的条件限制或者排斥潜在投标人.\"},{\"title\":\"根据《招标公告和公示信息发布管理办法》规定,发布媒介在发布依法必须招标项目的招标公告和公示信息活动中有下列情形之一的,由相应的省级以上发展改革部门或其他有关部门根据有关法律法规规定,责令改正；情节严重的,可以处1 万元以下罚款的(   )。\",\"score\":\"5\",\"op\":[\"A.违法收取费用\",\"B.无正当理由拒绝发布或者拒不按规定交互信息\",\"C.无正当理由延误发布时间\",\"D.因故意或重大过失导致发布的招标公告和公示信息发生遗漏、错误\",\"E.以上均正确\"],\"subjectType\":1,\"scoreType\":0,\"trueAnswer\":[\"1\",\"2\",\"3\",\"4\",\"5\"],\"answerAnalysis\":\"《招标公告和公示信息发布管理办法》第十八条　发布媒介在发布依法必须招标项目的招标公告和公示信息活动中有下列情形之一的,由相应的省级以上发展改革部门或其他有关部门根据有关法律法规规定,责令改正；情节严重的,可以处1 万元以下罚款：(一)违法收取费用；(二)无正当理由拒绝发布或者拒不按规定交互信息；(三)无正当理由延误发布时间；(四)因故意或重大过失导致发布的招标公告和公示信息发生遗漏、错误；(五)违反本办法的其他行为。\"},{\"title\":\"根据《招标公告和公示信息发布管理办法》规定,依法必须招标项目的中标候选人公示应当载明以下内容(   )。\",\"score\":\"5\",\"op\":[\"A.中标候选人排序、名称、投标报价、质量、工期(交货期),以及评标情况\",\"B.中标候选人按照招标文件要求承诺的项目负责人姓名及其相关证书名称和编号\",\"C.中标候选人响应招标文件要求的资格能力条件\",\"D.提出异议的渠道和方式\",\"E.招标文件规定公示的其他内容\"],\"subjectType\":1,\"scoreType\":0,\"trueAnswer\":[\"1\",\"2\",\"3\",\"4\",\"5\"],\"answerAnalysis\":\"《招标公告和公示信息发布管理办法》第六条依法必须招标项目的中标候选人公示应当载明以下内容：(一)中标候选人排序、名称、投标报价、质量、工期(交货期),以及评标情况；(二)中标候选人按照招标文件要求承诺的项目负责人姓名及其相关证书名称和编号；(三)中标候选人响应招标文件要求的资格能力条件；(四)提出异议的渠道和方式；(五)招标文件规定公示的其他内容.依法必须招标项目的中标结果公示应当载明中标人名称.\"},{\"title\":\"《招标公告和公示信息发布管理办法》规定：按照电子招标投标有关数据规范要求交互招标公告和公示信息文本的,发布媒介应当自收到起 24 小时内发布。\",\"score\":\"2\",\"op\":[\"A.对；\",\"B.错；\"],\"subjectType\":2,\"trueAnswer\":[\"1\"],\"answerAnalysis\":\"《招标公告和公示信息发布管理办法》第十一条,按照电子招标投标有关数据规范要求交互招标公告和公示信息文本的,发布媒介应当自收到起 12 小时内发布。\"},{\"title\":\"《招标公告和公示信息发布管理办法》规定：发布媒介应当按照规定采取有效措施,确保发布招标公告和公示信息的数据电文不被篡改、不遗漏和至少 15年内可追溯。\",\"score\":\"2\",\"op\":[\"A.对；\",\"B.错；\"],\"subjectType\":2,\"trueAnswer\":[\"1\"],\"answerAnalysis\":\"《招标公告和公示信息发布管理办法》第十一条,发布媒介应当按照规定采取有效措施,确保发布招标公告和公示信息的数据电文不被篡改、不遗漏和至少 10 年内可追溯。\"},{\"title\":\"《招标公告和公示信息发布管理办法》规定：其他媒介违规发布或转载依法必须招标项目的招标公告和公示信息的,由相应的省级以上发展改革部门或其他有关部门根据有关法律法规规定,责令改正；情节严重的,可以处 1 万元以下,5000元以上罚款。\",\"score\":\"2\",\"op\":[\"A.对；\",\"B.错；\"],\"subjectType\":2,\"trueAnswer\":[\"1\"],\"answerAnalysis\":\"《招标公告和公示信息发布管理办法》第十九条,其他媒介违规发布或转载依法必须招标项目的招标公告和公示信息的,由相应的省级以上发展改革部门或其他有关部门根据有关法律法规规定,责令改正；情节严重的,可以处 1 万元以下罚款。\"},{\"title\":\"《招标公告和公示信息发布管理办法》规定,拟发布的招标公告和公示信息文本应当由招标人或其招标代理机构盖章,或由主要负责人或其授权的项目负责人签名.采用数据电文形式的,应当按规定进行电子签名。\",\"score\":\"2\",\"op\":[\"A.对；\",\"B.错；\"],\"subjectType\":2,\"trueAnswer\":[\"1\"],\"answerAnalysis\":\"《招标公告和公示信息发布管理办法》第十条：拟发布的招标公告和公示信息文本应当由招标人或其招标代理机构盖章,并由主要负责人或其授权的项目负责人签名.采用数据电文形式的,应当按规定进行电子签名。\"}]', 34, 1, '2020-04-29 22:37:29', '2020-04-29 22:37:29', 1, 65.0);
